import React, { Component } from 'react';
import './App.css';
import RoomList from './components/RoomList';
import MessageList from './components/MessageList';
import * as firebase from 'firebase';


class App extends Component {
  render() {
    return (
      <div className="App">
        <RoomList
          firebase={ firebase }
        />
        <MessageList
          firebase={ firebase }
        />
      </div>
    );
  }
}

export default App;
